informacaoComplementar:
Necessidade de contratar empresa especializada para a locação de 02 (dois) smartphones e 02 (duas) impressoras portáteis térmicas, com o fornecimento contínuo de bobinas padronizadas, com vistas à realização da leitura e impressão simultânea das contas de água dos consumidores do município. 
A contratação justifica-se pela modernização do processo de leitura e entrega de contas, proporcionando:
    • Maior eficiência e celeridade na entrega das faturas aos usuários;
    • Redução de erros manuais, pois os dados são processados automaticamente;
    • Redução de custos operacionais com retrabalho e deslocamento;
    • Atendimento imediato ao consumidor, com emissão e entrega no local;
    • Integração com o sistema de gestão já utilizado pelo SAAE.
A opção pela locação, em detrimento da aquisição, visa garantir a atualização tecnológica contínua, manutenção inclusa e substituição imediata de equipamentos defeituosos, evitando prejuízos operacionais.
